def transform(sequence):
    count = 0
    prev_num = None
    transformed_seq = []

    for num in sequence:
        if num != '0':
            if prev_num == '0':
                count += 1
            else:
                transformed_seq.extend(['0']*count)
                count = 1
        transformed_seq.append(num)
        prev_num = num

    if count > 0:
        transformed_seq.extend(['0']*count)

    return ''.join(transformed_seq)

